import {
  NUMBER_FILTERS,
} from '../actions';

const filterNInitial = {
  filterByNumber: {
    column: '',
    operation: '',
    number: 0,
  },
};
const filtersNumbers = (state = filterNInitial, action) => {
  switch (action.type) {
    case NUMBER_FILTERS:
      return {
        ...state,
        filterByNumber: {
          column: action.column,
          operation: action.operation,
          number: action.number,
        },
      };
    default:
      return state;
  }
};


export default filtersNumbers;
